import React, { useState } from 'react';
import axios from 'axios';

interface SignupFormData {
    firstName: string;
    lastName: string;
    email: string;
    phone: string;
    gender: string;
    userType: string;
    hobbies: string[];
    profileImage: File | null;
    resume: File | null;
    agency: string;
}

const Signup: React.FC = () => {
    const [formData, setFormData] = useState<SignupFormData>({
        firstName: '',
        lastName: '',
        email: '',
        phone: '',
        gender: '',
        userType: 'Job Seeker',
        hobbies: [],
        profileImage: null,
        resume: null,
        agency: '',
    });

    const handleChange = (e: React.ChangeEvent<HTMLInputElement | HTMLSelectElement>) => {
        const { name, value, type } = e.target;

        if (type === 'checkbox') {
            const checked = (e.target as HTMLInputElement).checked;
            setFormData(prev => ({
                ...prev,
                hobbies: checked
                    ? [...prev.hobbies, value]
                    : prev.hobbies.filter(hobby => hobby !== value),
            }));
        } else if (type === 'file') {
            const files = (e.target as HTMLInputElement).files;
            if (name === 'profileImage' && files) {
                setFormData({ ...formData, profileImage: files[0] });
            } else if (name === 'resume' && files) {
                setFormData({ ...formData, resume: files[0] });
            }
        } else {
            setFormData({ ...formData, [name]: value });
        }
    };

    const handleSubmit = async (e: React.FormEvent<HTMLFormElement>) => {
        e.preventDefault();
        const data = new FormData();

        for (const key in formData) {
            const value = formData[key as keyof SignupFormData];
            if (Array.isArray(value)) {
                value.forEach(hobby => {
                    data.append('hobbies', hobby);
                });
            } else if (value !== null) {
                data.append(key, value);
            }
        }

        try {
            await axios.post('http://localhost:5001/api/signup', data);
            alert('Signup successful! Please check your email for login details.');
        } catch (error) {
            alert('Error signing up. Please try again.');
        }
    };

    return (
        <form onSubmit={handleSubmit}>
            <input name="firstName" onChange={handleChange} required placeholder="First Name" />
            <input name="lastName" onChange={handleChange} required placeholder="Last Name" />
            <input name="email" type="email" onChange={handleChange} required placeholder="Email" />
            <input name="phone" type="tel" pattern="[0-9]*" onChange={handleChange} required placeholder="Phone" />
            <div>
                <label>Gender:</label>
                <label><input type="radio" name="gender" value="Male" onChange={handleChange} required /> Male</label>
                <label><input type="radio" name="gender" value="Female" onChange={handleChange} required /> Female</label>
            </div>
            <select name="userType" onChange={handleChange}>
                <option value="Job Seeker">Job Seeker</option>
                <option value="Agency">Agency</option>
            </select>
            <div>
                <label>Hobbies:</label>
                <label><input type="checkbox" value="Sports" onChange={handleChange} /> Sports</label>
                <label><input type="checkbox" value="Dance" onChange={handleChange} /> Dance</label>
                <label><input type="checkbox" value="Reading" onChange={handleChange} /> Reading</label>
                <label><input type="checkbox" value="Singing" onChange={handleChange} /> Singing</label>
            </div>
            <input type="file" name="profileImage" onChange={handleChange} accept=".png, .jpg, .jpeg" />
            {formData.userType === 'Job Seeker' && (
                <>
                    <input type="file" name="resume" onChange={handleChange} accept=".docx, .pdf" />
                    <select name="agency" onChange={handleChange}>
                        <option value="">Select Agency</option>
                        {/* Add agencies here */}
                    </select>
                </>
            )}
            <button type="submit">Sign Up</button>
        </form>
    );
};

export default Signup;
